procedure.complex-attribute:
begin
	declare lvMessageId, lvReceiptHandle, lvMD5OfBody text;
	declare lvBody, lvResult longtext;
	declare lvUrl text default concat('"',aws_oracle_ext.sqs_lu_inited_queueurl(queue_name),'"');


	call aws_oracle_ext.sqs_aq_get_message_body(lvUrl, lvMessageId, lvReceiptHandle, lvMD5OfBody, lvBody);
	set message_properties = '';
	set msgid = aws_oracle_ext.sqs_lu_msgidtovbinary(lvMessageId);
	set payload = lvBody;

	if msgid is null then
	    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'timeout or end-of-fetch during message dequeue from';
	else
	    set lvResult = aws_oracle_ext.sqs_aq_delete_message(lvUrl, lvReceiptHandle);
	    call aws_oracle_ext.sqs_lu_delete_queue_message(queue_name, msgid);
	end if;
end

BEGIN
  DECLARE lvQueueUrl, tschema, tname, tdatatypeschema, tdatatypename, lvMessageId text;
  declare MessageId text default '"MessageId"'; 
  declare lvResult, lvDummy longtext;
  DECLARE id int;

    CALL aws_oracle_ext.sqs_lu_inited_queuetbl(queue_name, id, tschema, tname, tdatatypeschema, tdatatypename);

    IF id = -1 THEN
	    set lvQueueUrl = concat('"', aws_oracle_ext.sqs_lu_inited_queueurl(queue_name), '"');

	    set lvResult = aws_oracle_ext.sqs_aq_send_message(lvQueueUrl, payload);
	    call aws_oracle_ext.sqs_lu_jval2(substring(lvResult, locate(MessageId, lvResult, 1) + length(MessageId)+1), '"',lvMessageId, lvDummy);
	    set msgid = aws_oracle_ext.sqs_lu_msgidtovbinary(lvMessageId);
	    call aws_oracle_ext.sqs_lu_insert_queue_table(queue_name, tschema, tname, msgid, payload);

    END IF;
end

begin
	declare lqueue_name          text default queue_name;
	declare lqueue_table          text default queue_table;
	declare lqueue_type           integer default coalesce(queue_type, aws_oracle_ext.sqs_normal_queue());
	declare lmax_retries          double default max_retries;
    declare lretry_delay          double default coalesce(retry_delay, 0);
    declare lretention_time       double default coalesce(retention_time, 0);
    declare ldependency_tracking  decimal default coalesce(dependency_tracking, 0);
	declare lcomment              text DEFAULT comment;
	declare lauto_commit          decimal DEFAULT coalesce(auto_commit, 1);

	declare QueueUrl text default '"QueueUrl"';
	declare lvResult, lvDummy longtext;
	declare lvschemaname, lvtablename, lvUrl, lvArn, lvQtype, lvQPureName, lvQName text; 
	declare lnTid int;
	call aws_oracle_ext.sqs_lu_define_table(queue_table, lvschemaname, lvtablename);

	select t.id
	  into lnTid
	  from aws_oracle_ext.sqs_queues_tables t join information_schema.tables q on t.tschema = q.table_schema
								     										 and t.tname = q.table_name
	 where t.tschema = lvschemaname 
	   and t.tname = lvtablename;

	if not exists (select 1 from information_schema.tables
	                 where (table_schema = lvschemaname) and (table_name = lvtablename)) then
	SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'invalid value NULL, QUEUE_TABLE should be defined', MYSQL_ERRNO = 1001;                 
	end if;	                 

	set lvResult := aws_oracle_ext.sqs_aq_create_queue(lqueue_name, '');

	call aws_oracle_ext.sqs_lu_jval2(substring(lvResult, locate(QueueUrl, lvResult, 1) + length(QueueUrl)+1), '"',lvUrl, lvDummy);
	set lvUrl = trim(both '"' from aws_oracle_ext.sqs_lu_trim(lvUrl));
	set lvArn = replace(replace(lvUrl, 'https://', 'arn:'),'/',':');

	set lvQPureName := reverse(substring_index(reverse(lvUrl), '/',1));
	set lvQName := replace(lvQPureName, '.fifo', '');

	if lvUrl like '%.fifo' then
		set lvQtype = aws_oracle_ext.sqs_queue_fifo();
	end if;

	insert into aws_oracle_ext.sqs_queues_settings(qname, qpurename, url, arn, qtype, tableid)
		      select lvQName, lvQPurename, lvUrl, lvArn, lvQtype, lnTid;
end

