  declare l_broken boolean default broken;
  declare l_next_date timestamp default coalesce( next_date, now() );

  update aws_oracle_ext.jobs j
     set broken = case when l_broken then 'Y' else 'N' end
	   , next_date = l_next_date
   where j.job = l_job;
END

