begin
  declare l_job bigint unsigned;
  declare l_now timestamp(6) default now(6);
  declare l_what longtext;
  declare l_schema_user varchar(64);
  declare l_limit int unsigned default greatest( coalesce( p_limit, 100 ), 1 );
  declare l_next_date_before timestamp default coalesce( p_next_date_before, l_now );

  drop temporary table if exists aws_oracle_ext$jobs;
  create temporary table if not exists aws_oracle_ext$jobs( job bigint unsigned, what longtext, schema_user varchar( 64 ) );

  begin
    insert into aws_oracle_ext$jobs
    select job 
         , what
         , schema_user
      from aws_oracle_ext.jobs 
     where this_date is null 
       and broken <> 'Y'
       and next_date <= l_next_date_before
     limit l_limit 
       for update;

    update aws_oracle_ext.jobs j
       set this_date = l_now
     where j.job in ( select tj.job from aws_oracle_ext$jobs tj );

    select job, what, schema_user as search_path from aws_oracle_ext$jobs;
  end;
end

