BEGIN

    DECLARE vPagePart TEXT CHARSET utf8;
    DECLARE Vcolumn_value TEXT CHARSET utf8;
    DECLARE Vid BIGINT;
    DECLARE vHeaderPosition BIGINT;

    DECLARE headerExists BOOLEAN DEFAULT FALSE;

    DECLARE done INT DEFAULT FALSE;
    DECLARE htp_buf CURSOR FOR
        SELECT id,
            column_value
        FROM aws_oracle_ext_data.aws_htbuf_arr
        ORDER BY id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    IF COALESCE(pPagePart, NULL) NOT IN ('headers', 'body') THEN

        SET vPagePart := 'body';

    ELSE

        SET vPagePart := pPagePart;

    END IF;

    OPEN htp_buf;

    htp_buf_read: LOOP

        FETCH htp_buf INTO Vid, Vcolumn_value;

        IF done THEN
            LEAVE htp_buf_read;
        END IF;

        IF Vcolumn_value = '

' THEN

            SET vHeaderPosition := Vid;
            SET headerExists := TRUE;
            LEAVE htp_buf_read;

        END IF;

        IF Vcolumn_value RLIKE '^
$' THEN

            IF vHeaderPosition IS NOT NULL THEN

                SET vHeaderPosition := Vid;
                SET headerExists := TRUE;
                LEAVE htp_buf_read;

            ELSE

                SET vHeaderPosition := Vid;

            END IF;

        END IF;

        IF Vcolumn_value RLIKE '
$' AND Vcolumn_value NOT RLIKE '^
$' THEN

            SET vHeaderPosition := Vid;

        END IF;

        IF Vcolumn_value NOT RLIKE '
$' AND vHeaderPosition IS NOT NULL THEN

            SET vHeaderPosition := NULL;

        END IF;

    END LOOP htp_buf_read;

    CLOSE htp_buf;

    IF NOT headerExists THEN

        SET vHeaderPosition := NULL;

    END IF;

    IF vPagePart = 'headers' THEN

        SELECT aha.column_value
        FROM aws_oracle_ext_data.aws_htbuf_arr aha
        WHERE aha.id < vHeaderPosition
        ORDER BY id;

    ELSE

        SELECT aha.column_value
        FROM aws_oracle_ext_data.aws_htbuf_arr aha
        WHERE aha.id > COALESCE(vHeaderPosition, 0)
        ORDER BY id;

    END IF;

END

