BEGIN

    IF @NLS_TERRITORY IS NULL THEN

        SELECT COALESCE(MAX(nls_territory),'AMERICA')
        INTO @NLS_TERRITORY
        FROM aws_oracle_ext.nls_parameters 
        WHERE pg_territory_ux = @@lc_time_names;

        SELECT anp.params_dictionary ->> '$.NLS_CURRENCY',
            anp.params_dictionary ->> '$.NLS_ISO_CURRENCY',
            anp.params_dictionary ->> '$.NLS_DATE_FORMAT',
            anp.params_dictionary ->> '$.NLS_DUAL_CURRENCY',
            anp.params_dictionary ->> '$.NLS_NUMERIC_CHARACTERS',
            anp.params_dictionary ->> '$.NLS_TIMESTAMP_FORMAT'
        INTO @NLS_CURRENCY,
            @NLS_ISO_CURRENCY,
            @NLS_DATE_FORMAT,
            @NLS_DUAL_CURRENCY,
            @NLS_NUMERIC_CHARACTERS,
            @NLS_TIMESTAMP_FORMAT
        FROM aws_oracle_ext.nls_parameters anp
        WHERE anp.nls_territory = @NLS_TERRITORY;

    END IF;

END

BEGIN

    DECLARE i INT;
    DECLARE vKeys JSON;

    CREATE TEMPORARY TABLE IF NOT EXISTS aws_oracle_ext_data.aws_cgi_env
    (
        id BIGINT NOT NULL AUTO_INCREMENT,
        cgi_var_name TEXT CHARSET utf8 NULL,
        cgi_var_val TEXT CHARSET utf8 NULL,
        PRIMARY KEY (id)
    );

    TRUNCATE TABLE aws_oracle_ext_data.aws_cgi_env;

    SET vKeys := JSON_KEYS(pParams);

    SET i := 0;

    WHILE i < JSON_LENGTH(vKeys) DO

        INSERT INTO aws_oracle_ext_data.aws_cgi_env
        (
            cgi_var_name,
            cgi_var_val
        )
        VALUES
        (
            JSON_UNQUOTE(
                JSON_EXTRACT(
                    vKeys,
                    CONCAT(
                        '$[',
                        i,
                        ']'
                    )
                )
            ),
            JSON_UNQUOTE(
                JSON_EXTRACT(
                    pParams,
                    CONCAT(
                        '$.',
                        JSON_UNQUOTE(
                            JSON_EXTRACT(
                                vKeys,
                                CONCAT(
                                    '$[',
                                    i,
                                    ']'
                                )
                            )
                        )
                    )
                )
            )
        );

        SET i = i + 1;

    END WHILE;

    INSERT INTO aws_oracle_ext_data.aws_cgi_env
    (
        cgi_var_name, cgi_var_val
    )
    VALUES
    (
        'REMOTE_USER',
        USER()
    );

END

