BEGIN

    DECLARE done INT DEFAULT FALSE;

    DECLARE vcgi_var_name TEXT CHARSET utf8;
    DECLARE vcgi_var_val TEXT CHARSET utf8;

    DECLARE cgi_env CURSOR FOR
        SELECT cgi_var_name,
            cgi_var_val
        FROM aws_oracle_ext_data.aws_cgi_env
        ORDER BY id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cgi_env;

    cgi_env_read: LOOP

        FETCH cgi_env INTO vcgi_var_name, vcgi_var_val;

        IF done THEN
            LEAVE cgi_env_read;
        END IF;

        CALL aws_oracle_ext.htp$print
        (
            CONCAT(
                vcgi_var_name,
                ' = ',
                vcgi_var_val,
                aws_oracle_ext.htf$nl(NULL,NULL)
            )
        );

    END LOOP cgi_env_read;

    CLOSE cgi_env;

END

