BEGIN

    DECLARE vSchema TEXT CHARSET utf8;
    DECLARE vRoutineName TEXT CHARSET utf8;
    DECLARE vRoutineExists SMALLINT DEFAULT 0;

    DECLARE vSQL TEXT;
    DECLARE vArgs TEXT CHARSET utf8;

    DECLARE vParameterName TEXT;
    DECLARE vparval TEXT CHARSET utf8;
    DECLARE vParameterDataType TEXT;
    DECLARE done INT DEFAULT FALSE;

    DECLARE curparams CURSOR FOR
        SELECT LOWER(parameter_name) parameter_name,
            p.data_type
        FROM information_schema.parameters p
        WHERE p.specific_schema = vSchema
        AND p.specific_name = vRoutineName
        ORDER BY p.ordinal_position;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    DECLARE EXIT HANDLER FOR 1305
    BEGIN
        SET @owa_wrapper_sql := NULL; 
        CALL aws_oracle_ext.owa_util$status_line(404,'',1);
    END;

    DECLARE EXIT HANDLER FOR 1318
    BEGIN
        SET @owa_wrapper_sql := NULL; 
        CALL aws_oracle_ext.owa_util$status_line(404,'',1);
    END;

    IF LOCATE('.', pRoutinePath ) = 0 THEN

        SIGNAL SQLSTATE '42000' SET MYSQL_ERRNO = 1305;

    ELSE

        SET vSchema := TRIM(LOWER(SUBSTRING_INDEX(pRoutinePath, '.', 1)));
        SET vRoutineName := TRIM(LOWER(SUBSTRING_INDEX(pRoutinePath, '.', -1)));

    END IF;

    SELECT COUNT(*)
    INTO vRoutineExists
    FROM information_schema.routines r
    WHERE r.routine_schema = vSchema
    AND r.routine_name = vRoutineName;

    IF vRoutineExists <> 1 THEN

        SIGNAL SQLSTATE '42000' SET MYSQL_ERRNO = 1305;

    ELSE

        SET vArgs := '';

        IF pParams <> CAST('{}' AS JSON) THEN

            OPEN curparams;

            check_params: LOOP

                FETCH curparams INTO vParameterName, vParameterDataType;

                IF done THEN

                    LEAVE check_params;

                END IF;

                IF JSON_CONTAINS_PATH(
                    pParams,
                    'one',
                    CONCAT(
                        '$.',
                        vParameterName
                    )
                ) <> 1 THEN

                    SIGNAL SQLSTATE '42000' SET MYSQL_ERRNO = 1318;

                END IF;

                SET vparval := JSON_UNQUOTE(
                    JSON_EXTRACT(
                        pParams,
                        CONCAT(
                            '$.',
                            vParameterName,
                            '[0]'
                        )
                    )
                );

                SET vArgs := CONCAT(
                    vArgs,
                    CASE WHEN vParameterDataType = 'text' AND CHAR_LENGTH(vparval) > 0 THEN ''' ELSE '' END,
                    CASE WHEN CHAR_LENGTH(vparval) > 0 THEN vparval ELSE 'NULL' END,
                    CASE WHEN vParameterDataType = 'text' AND CHAR_LENGTH(vparval) > 0 THEN ''' ELSE '' END,
                   ','
                );

            END LOOP check_params;

            CLOSE curparams;

        END IF;

    END IF;

    IF vArgs = '' THEN

        SET vArgs := '()';

    ELSE

        SET vArgs := CONCAT(
            '(',
            SUBSTR(
                vArgs,
                1,
                CHAR_LENGTH(vArgs) - 1
            ),
            ')'
        );

    END IF;

    SET vSQL := CONCAT(
        'CALL ',
        vSchema,
        '.',
        vRoutineName,
        vArgs
    );


    SET @owa_wrapper_sql := vSQL;

    PREPARE owa_wrapper_stmt FROM @owa_wrapper_sql;
    EXECUTE owa_wrapper_stmt;
    DEALLOCATE PREPARE owa_wrapper_stmt;

END

BEGIN
DECLARE vMessage VARCHAR(255) CHARSET utf8;

    IF pErrorCode > 0 THEN

        SET vMessage := CONCAT('ORA-21000: error number argument to raise_application_error of ', pErrorCode,' is out of range');

    ELSE

        SET vMessage := CONCAT('ORA-', LPAD(ABS(pErrorCode), 5, 0), ': ', pErrorMessage);

    END IF;

    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = vMessage;

END

BEGIN

  DECLARE l_start_with DECIMAL(65) SIGNED;
  DECLARE l_increment_by DECIMAL(65);
  DECLARE l_max_value DECIMAL(65) SIGNED;
  DECLARE l_min_value DECIMAL(65) SIGNED;
  DECLARE l_is_cycle  CHAR(1);

  DECLARE c_max_value DECIMAL(65) SIGNED;
  DECLARE c_min_value DECIMAL(65) SIGNED;
  SET c_max_value := 9999999999999999999999999999;
  SET c_min_value := -9999999999999999999999999999;

  /*Creation of a table for sequences*/
  CREATE SCHEMA IF NOT EXISTS aws_oracle_ext_data;

  CREATE TABLE IF NOT EXISTS aws_oracle_ext_data.sequences
  ( name VARCHAR(60) NOT NULL COMMENT 'Unique name of Sequence',
    schema_name VARCHAR(50) NOT NULL COMMENT 'Schema name',
    increment_by DECIMAL(65) SIGNED NOT NULL DEFAULT 1
      COMMENT 'Interval between sequence numbers. Value can be any positive or negative integer, but it cannot be 0. If this value is negative, then the sequence descends. If the value is positive, then the sequence ascends',
    start_with DECIMAL(65) SIGNED NOT NULL
      COMMENT 'First sequence number to be generated. For ascending sequences, the default value is the minimum value of the sequence. For descending sequences, the default value is the maximum value of the sequence',
    max_value DECIMAL(65) SIGNED NOT NULL COMMENT 'Maximum value the sequence can generate',
    min_value DECIMAL(65) SIGNED NOT NULL COMMENT 'Minimum value of the sequence',
    is_cycle CHAR(1) NOT NULL DEFAULT 'N'
      COMMENT 'Indicate that the sequence continues to generate values after reaching either its maximum or minimum value. Y - continues to generate, N - not continues',
    curr_val DECIMAL(65) SIGNED DEFAULT NULL COMMENT 'Sequence current value',
    CONSTRAINT pk_sequences PRIMARY KEY (name, schema_name)
  )
  COMMENT='Sequences storage';  

  /*Check of all input parameters on correctness*/
  /*Check parameter "seq_max_value" and "seq_min_value" on NULLS values*/
  IF seq_max_value IS NULL THEN
     SET l_max_value := c_max_value;
  ELSE 
     SET l_max_value := seq_max_value;
  END IF;
  IF seq_min_value IS NULL THEN
     SET l_min_value := c_min_value;
  ELSE
     SET l_min_value := seq_min_value;
  END IF;

  /*Parameter "seq_increment_by" can not be 0*/  
  IF seq_increment_by IS NULL THEN
     SET l_increment_by := 1;
  ELSEIF seq_increment_by = 0 THEN
    BEGIN
      SIGNAL SQLSTATE VALUE '45001'
      SET MESSAGE_TEXT = 'Parameter "Increment by" can't be 0 ';
    END;     
  ELSE
    SET l_increment_by := seq_increment_by;
  END IF;

  /*Check parameter "seq_start_with"*/  
  IF seq_start_with IS NULL AND l_increment_by > 0 THEN  
    SET l_start_with := l_min_value;
  ELSEIF seq_start_with IS NULL AND l_increment_by < 0 THEN  
    SET l_start_with := l_max_value;
  ELSEIF l_increment_by < 0 AND seq_start_with > l_max_value THEN
    BEGIN
      SIGNAL SQLSTATE VALUE '45002'
      SET MESSAGE_TEXT = 'For descending sequence "Start with" must be less than "Max value"';
    END;     
  ELSEIF l_increment_by > 0 AND seq_start_with < l_min_value THEN
    BEGIN
      SIGNAL SQLSTATE VALUE '45003'
      SET MESSAGE_TEXT = 'For ascending sequence "Start with" must be greater than "Min value"';
    END; 
  ELSE 
    SET l_start_with := seq_start_with;    
  END IF;    

  /*Check parameter "seq_max_value" greater than "min_value" and NULLS values*/    
  IF l_max_value < l_min_value THEN
    BEGIN
      SIGNAL SQLSTATE VALUE '45004'
      SET MESSAGE_TEXT = 'Parameter "Max Value" must be greater than "Min Value"';
    END;   
  END IF;
  /*Check parameter "seq_is_cycle" IN ('N','Y')*/  
  IF seq_is_cycle IS NULL THEN 
     SET l_is_cycle := 'N';
  ELSEIF seq_is_cycle NOT IN ('Y','N') THEN
    BEGIN
      SIGNAL SQLSTATE VALUE '45005'
      SET MESSAGE_TEXT = 'Parameter "Is Cycle" must be N(nocycle) or Y(cycle)';
    END;
  ELSE
    SET l_is_cycle := seq_is_cycle;
  END IF;

  INSERT IGNORE INTO aws_oracle_ext_data.sequences(name,schema_name,increment_by,start_with,max_value,min_value,is_cycle)
  VALUES(seq_name,seq_schema_name,l_increment_by,l_start_with,l_max_value,l_min_value,l_is_cycle);

END

BEGIN   
   DECLARE l_null VARCHAR(1);
   DECLARE CONTINUE HANDLER FOR 1146 SET l_null := '';

   DELETE FROM aws_oracle_ext_data.sequences
   WHERE name = seq_name
   AND schema_name = seq_schema_name;

   DELETE FROM aws_oracle_ext_data.sequences_for_session
   WHERE name = seq_name
   AND schema_name = seq_schema_name;

END

