set REGISTER_TABLE = replace(REGISTER_TABLE, '%schema%', quote(lvschemaname)); set REGISTER_TABLE = replace(REGISTER_TABLE, '%table%', quote(lvtablename));
set EXECUTE_BLOCK = replace(EXECUTE_BLOCK, '%create%', TABLE_DDL); set @sqs_sql_stmt = EXECUTE_BLOCK;
prepare stmt from @sqs_sql_stmt; execute stmt; deallocate prepare stmt;
insert into aws_oracle_ext.sqs_queues_tables (tschema, tname, tdatatypeschema, tdatatypename) values (lvschemaname, lvtablename, '', 'text'); end

begin
	declare lvschemaname text default SUBSTRING_INDEX(lower(pvtablename), '.', 1);
 	declare lvtablename text default SUBSTRING_INDEX(lower(pvtablename), '.', -1);

	if lower(pvtablename) = lvschemaname and lvschemaname = lvtablename then
		set ovschemaname = database();
		set ovtablename = lvtablename;
	else
		set ovschemaname = lvschemaname;
		set ovtablename = lvtablename;
	end if;
end

