BEGIN
  declare lnTID int;

  SELECT -1 id, tschema, tname, '' AS tdatatypeschema, 'text' AS tdatatypename
    INTO pnid, pvtschema, pvtname, pvtdatatypeschema, pvtdatatypename
    FROM aws_oracle_ext.sqs_vw_queues_settings q
   WHERE q.qName = pvname;

  if pnid is null or pvtname is null or pvtdatatypename is null then
	  SELECT q.tableid
	    INTO lnTID
	    FROM aws_oracle_ext.sqs_queues_settings q
	   WHERE q.qName = pvname;

	  if lnTID is null then
  	  	SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Queue does not exist or does not define', MYSQL_ERRNO = 24010;
  	  else
  	  	SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid value. Queue table or type does not exist or does not define for queue', MYSQL_ERRNO = 24000;
  	  end if;
  end if;
END

begin DECLARE INSERT_DML longtext default 'INSERT INTO %schema%.%table% (' 'q_name, msgid, corrid, ' 'priority, state, delay, ' 'expiration, time_manager_info, local_order_no, ' 'chain_no, cscn, dscn, ' 'enq_time, enq_uid, enq_tid, ' 'deq_time, deq_uid, deq_tid, ' 'retry_count, exception_qschema, exception_queue, ' 'step_no, recipient_key, dequeue_msgid, ' 'sender_name, sender_address, sender_protocol, ' 'user_data, user_prop' ')' 'VALUES ( ' '%q_name%, aws_oracle_ext.sqs_lu_msgidtovbinary(%msgid%), null, ' '0, 0, null, ' 'null, null, 0, ' '0, 0, 0, ' 'now(), substring_index(current_user(),'@', 1), connection_id(), ' 'null, null, null, ' '0, null, null, ' '0, 0, null, ' 'null, null, 0, ' '%payload%, null' ')';
SET INSERT_DML = REPLACE(INSERT_DML, '%schema%', tschema); SET INSERT_DML = REPLACE(INSERT_DML, '%table%', tname); SET INSERT_DML = REPLACE(INSERT_DML, '%q_name%', QUOTE(queue_name)); SET INSERT_DML = REPLACE(INSERT_DML, '%msgid%', QUOTE(aws_oracle_ext.sqs_lu_msgidtotext(msgid))); SET INSERT_DML = REPLACE(INSERT_DML, '%payload%', QUOTE(payload));
SET @sqs_sql_stmt = INSERT_DML;
PREPARE stmt FROM @sqs_sql_stmt; EXECUTE stmt; DEALLOCATE PREPARE stmt; end

begin
	declare i int default 0;
	declare lvDummy longtext default substring(pvText, instr(pvText, pvDelimeter)+1);
	declare lnD int default -1;

	set pvValue = pvDelimeter;
	main: while lnD !=0 and i<10000 do
		set i = i+1;
		set lnD = instr(lvDummy, pvDelimeter);

		if lnD > 0 then
			set pvValue = concat(pvValue, substring(lvDummy, 1, lnD));
			if substring(lvDummy, lnD -1, 1) != '\' then
				set pvTail = substring(lvDummy, lnD +1);
				leave main;
			end if;

			set lvDummy = substring(lvDummy, lnD +1);

		else
			leave main;
		end if;

	end while main;
end

begin
  declare l_now timestamp(6) default now(6);
  declare l_failure boolean default p_error_message is not null and p_error_message <> '';
  declare l_interval varchar( 8000 );
  declare l_next_date timestamp(6);
  declare l_err_msg varchar( 100 ) default concat( 'Job #', p_job, ' not found' );

  begin
    begin
      DECLARE CONTINUE HANDLER FOR NOT FOUND 
        begin
          signal sqlstate '45000' set message_text = l_err_msg, mysql_errno = 1002;
        end;
      select j.`interval` into l_interval from aws_oracle_ext.jobs j where j.job = p_job;
    end;

    set @l_int_qry = concat( 'select ', l_interval, ' into @l_next_date' );

    prepare stmt from @l_int_qry;
    execute stmt;
    set l_next_date = @l_next_date;
    deallocate prepare stmt;

    if l_next_date is not null or l_failure then
      update aws_oracle_ext.jobs j
         set last_date = case when l_failure then last_date else this_date end
           , total_time = total_time + case when l_failure then 0 else TIMESTAMPDIFF(MICROSECOND, this_date, l_now)/1000000 end
           , this_date = null
           , failures = case when l_failure then failures + 1 else 0 end
           , broken = case when l_failure and failures + 1 > 16 then 'Y' else 'N' end
           , last_failure_message = case when l_failure then p_error_message end
           , next_date = coalesce( l_next_date, next_date )
       where j.job = p_job
         and j.this_date is not null;
    end if;   

    if l_next_date is null and not l_failure then
      delete from aws_oracle_ext.jobs where job = p_job;
    end if;
  end;
end

BEGIN
    DECLARE vException TEXT;
    DECLARE vMessage TEXT;

    DECLARE EXIT HANDLER FOR NOT FOUND
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid exception';

    SET vException := TRIM(LOWER(src_exception));

    IF vException = 'no_data_found' THEN

        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No data found';

    END IF;

    SELECT CONCAT(
        'ORA',
        oe.code,
        ': ',
        oe.msg
    ) AS msg
    INTO vMessage
    FROM aws_oracle_ext.utl_file$oraerrors oe
    WHERE oe.src_exception = vException;

    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = vMessage;

END

BEGIN

DECLARE vId BIGINT;
DECLARE rc TINYINT;

    SET vId := TRIM(
        SUBSTRING_INDEX(
            SUBSTRING_INDEX(
                REPLACE(
                    REPLACE(
                        file,
                        '{',
                        ''
                    ),
                    '
',
                    ''
                ),
                ',',
                1
            ),
            ':',
            -1
        )
    );

    DELETE FROM aws$utl_file_files
    WHERE id = vId;

    SELECT ROW_COUNT()
    INTO rc;

    IF rc <> 1 THEN

        CALL aws_oracle_ext.utl_file$exceptions('invalid_filehandle');

    END IF;

END

BEGIN
DECLARE vDirectory TEXT;
DECLARE vsrcBucket TEXT;
DECLARE vdstBucket TEXT;
DECLARE vResponse TEXT;
DECLARE vPayload TEXT;
DECLARE vEXCEPTION TEXT;

DECLARE EXIT HANDLER FOR NOT FOUND
    CALL aws_oracle_ext.utl_file$exceptions('invalid_path');

    SELECT directory_name,
        s3bucket
    INTO vDirectory,
        vsrcBucket
    FROM aws_oracle_ext.directory
    WHERE directory_name = src_location;

    IF src_location <> dest_location THEN

        SELECT directory_name,
            s3bucket
        INTO vDirectory,
            vdstBucket
        FROM aws_oracle_ext.directory
        WHERE directory_name = dest_location;

    ELSE

        SET vdstBucket := vsrcBucket;

    END IF;

    SET vPayload := CONCAT(
        '{"Action": "FCOPY", "srcBucket": "',
        vsrcBucket,
        '", "srcDIRECTORY": "',
        src_location,
        '", "srcFilename": "',
        src_filename,
        '", "dstBucket": "',
        vdstBucket,
        '", "dstDIRECTORY": "',
        dest_location,
        '", "dstFilename": "',
        dest_filename,
        '"}'
    );

    SET vResponse := lambda_sync
    (
        aws_oracle_ext.get_service_setting
        (
            'UTL_FILE',
            'LAMBDA_ARN'
        ),
        vPayload    
    );

    IF LOCATE('error', vResponse) >0 THEN

        SET vEXCEPTION := REPLACE(
            REPLACE(
                REPLACE(
                    REPLACE(
                        TRIM(
                            SUBSTRING_INDEX(
                                vResponse,
                                ':',
                                -1
                            )
                        ),
                        '"',
                        ''
                    ),
                    '}',
                    ''
                ),
                '
',
                ''
            ),
            ' ',
            ''
        );

        IF vEXCEPTION = '-1' THEN

            SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'S3 error';

        END IF;

        CALL aws_oracle_ext.utl_file$exceptions(vEXCEPTION);

    END IF;

END

