        vDirectory,
        '", "filename": "',
        vFilename,
        '", "buffer": "',
        SUBSTR(buffer, 1, 32767),
        '"}'
    );

    SET vResponse := lambda_sync
    (
        aws_oracle_ext.get_service_setting
        (
            'UTL_FILE',
            'LAMBDA_ARN'
        ),
        vPayload    
    );

    IF LOCATE('error', vResponse) >0 THEN

        SET vEXCEPTION := REPLACE(
            REPLACE(
                REPLACE(
                    REPLACE(
                        TRIM(
                            SUBSTRING_INDEX(
                                vResponse,
